import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1 className="title">Argentina</h1>
        <Map
          data={{
            map: MAP_JSON,
            width: 600,
            height: 500,
            center: [-62, -40],
            scale: 420,
            currency: "$"
          }}
        />
      </div>
    );
  }
}

export default App;
